import React from "react";
import menu from "./assets/menu.png";

function HeaderTop() {
  return (
    <div>
      <div>
        <div className="menu">
          <img src={menu} alt="menu" />
        </div>
      </div>
    </div>
  );
}

export default HeaderTop;
